$("button").click(function(){
    var mood = $("input").val();
    if(mood === "happy"){
        clearImages();
        happy();
    }else if(mood === "sad"){
        clearImages();
        sad();
    }else if(mood === "hungry"){
        clearImages();
        hungry();
    }else if(mood === "tired"){
        clearImages();
        tired();
    }else if(mood === ""){
        clearImages();
        nothing();
    }else if(mood === "neutral"){
        clearImages();
        neutral();
    }else if(mood === "anxious"){
        clearImages();
        anxious();
    }else if(mood === "mad"){
        clearImages();
        mad();
    }else if(mood === "calm"){
        clearImages();
        calm();
    }else{
        alert("place in either of these inputs; happy, sad, hungry, tired neutral, anxious, calm, or mad");
    }
    
});

function clearImages(){
    $(".images").html("");
}

function happy(){
    backgroundColor("yellow");
    textColor("grey");
    images(happyImages);
}

function sad(){
    backgroundColor("blue");
    textColor("red");
    images(sadImages);
}

function hungry(){
    backgroundColor("orange");
    textColor("black");
    images(hungryImages);
}

function tired(){
    backgroundColor("grey");
    textColor("white");
    images(tiredImages);
}

function nothing(){
    backgroundColor("black");
    textColor("black");
    images(nothingImage);
}

function neutral(){
    backgroundColor("black");
    textColor("white");
    images(neutralImages);
}

function anxious(){
    backgroundColor("violet");
    textColor("orange");
    images(anxiousImages);
}

function mad(){
    backgroundColor("#b34d4d");
    textColor("#cc6600");
    images(madImages);
}

function calm(){
    backgroundColor("#33cccc");
    textColor("#f471f4");
    images(calmImages);
}


function backgroundColor(Bcolor){
    $("body").css("background-color",Bcolor);
}

function textColor(color){
    $("body").css("color", color);
}

function images(images){
    images.forEach(function(img){
    $(".images").append("<img src="+ img +">");
    });
}